import logo from './logo.svg';
import './App.css';

function App() {

  let headerPage =       
  <header className="App-header">
    <img src={logo} className="App-logo" alt="logo" />
    <p>
      Edit <code>src/App.js</code> and save to reload. yo
    </p>
    <a
      className="App-link"
      href="https://reactjs.org"
      target="_blank"
      rel="noopener noreferrer"
    >
      Learn React
    </a>
</header>

let bodyPage =  
<body> 
  <h1>Globeboarding</h1>
</body>


  return (
    <div className="App">
        {headerPage}
        {body}
    </div>
  );
}

export default App;
